import './MainNavBar.css';

function MainNavBar() {
  return (
    <nav className="main-navbar">
      <ul className="menu">
        <li>홈</li>
        <li>소개</li>
        <li>연락처</li>
      </ul>
    </nav>
  );
}

export default MainNavBar;
